        EvidenceKey(**{'key': 'gerp', 'mandatory': False, 'max_share_level': 'logged_in_users', 'order': 15, 'label': 'GERP', 'sub_label': 'Conservation', 'description': 'Genomic Evolutionary Rate Profiling (GERP) score. <p> Score range: -12.3 to 6.17 <p> GERP identifies constrained elements in multiple alignments by quantifying substitution deficits. These deficits represent substitutions that would have occurred if the element were neutral DNA, but did not occur because the element has been under functional constraint. We refer to these deficits as "Rejected Substitutions". Rejected substitutions are a natural measure of constraint that reflects the strength of past purifying selection on the element.', 'examples': [], 'options': [], 'see': 'http://mendel.stanford.edu/SidowLab/downloads/gerp/', 'evidence_category': 'CP', 'value_type': 'F', 'default_crit_evaluation': None, 'allow_custom_values': False, 'hide': False, 'immutable': False, 'copy_consensus': False, 'variantgrid_column_id': 'gerp_pp_rs', 'created': '2019-10-22 22:46:59.655933+00:00', 'modified': '2019-10-22 22:46:59.655941+00:00'}),
