        EvidenceKey(**{'key': 'gnomad_oe_lof', 'mandatory': False, 'max_share_level': 'logged_in_users', 'order': 10, 'label': 'gnomAD LoF observed-expected score', 'sub_label': None, 'description': "Observed/expected (oe) score for the gene being 'loss-of-function' intolerant. Low oe values are indicative of strong intolerance.  <b>It is important to consider the confidence interval when using oe.</b> Please include the CI in brackets when entering data as per the example above. <p> From gnomad: A gene with an LoF oe of 0.4 can be interpreted as a gene where only 40% of the expected loss-of-function variants were observed and therefore is likely under selection against LoF variants. In addition, the 90% CI allows us to clearly distinguish cases where there is a lot of uncertainty about the constraint for that gene due to sample size... for interpretation of Mendelian cases, we suggest using the upper bound of the oe confidence interval < 0.35 if a hard threshold is needed.", 'examples': ['0.73 (0.59 - 0.92)'], 'options': [], 'see': None, 'evidence_category': 'H', 'value_type': 'F', 'default_crit_evaluation': None, 'allow_custom_values': False, 'hide': False, 'immutable': False, 'copy_consensus': True, 'variantgrid_column_id': None, 'created': '2019-10-22 22:46:59.656366+00:00', 'modified': '2020-06-19 06:51:26.303200+00:00'}),
